options.rowCallback:
function(row, data, displayNum, displayIndex, dataIndex) {
var value=data[0]; $(this.api().cell(row, 0).node()).css({'font-weight':'bold','color':'#161616','background-color':value == "WSoA (previous framework); progress made on all weaknesses" ? "#73a773" : value == "Written Statement of Action (previous framework); not revisited" ? "red" : value == "Inconsistent experiences and outcomes (new framework)" ? "red" : value == "Typically positive experiences and outcomes (new framework)" ? "#73a773" : value == "WSoA (previous framework); progress not made on all weaknesses" ? "orange" : value == "No Written Statement of Action (previous framework)" ? "#73a773" : value == "Widespread and/or systemic failings (new framework)" ? "red" : value == "Area not yet inspected" ? "white" : null});
