ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}
